import { React } from "react";
import { ListGroup, ListGroupItem } from "reactstrap";

const Menu = () => {
    return (

        <ListGroup>
            <ListGroupItem tag="a" href="/" action>Home
            </ListGroupItem>
            <ListGroupItem tag="a" href="add-course" action>AddCourse
            </ListGroupItem>
            <ListGroupItem tag="a" href="view-courses" action>View Course
            </ListGroupItem>
            <ListGroupItem tag="a" href="#" action>About
            </ListGroupItem>
            <ListGroupItem tag="a" href="#" action>Contact
            </ListGroupItem>

        </ListGroup>
    )
}

export default Menu;
